import React, { useState,useEffect } from 'react';

const Dependent = ()=>{
    const [AllDependents,setDependents] = useState([]);
    const GetDependent= async()=>{
        try {
            const query = await fetch('http://localhost:5000/dependents');
            const data = await query.json();
            setDependents(data);
        } catch (error) {
            console.log(error);
        }
    };
    useEffect(()=>{
        GetDependent();
    },[]);
    return (
<div className='p-5'>
<h1>All Dependents</h1>
<hr></hr>
<table class="mt-5 table table-borderless table-dark">
  <thead>
    <tr className='bg-info'>
      <th scope="col">#</th>
      <th scope="col">Department Name</th>
      <th scope="col">Location</th>
    </tr>
  </thead>
  <tbody>
{AllDependents.map(dep => (
    <tr key={dep.dependent_id}>
        <td>{dep.dependent_id}</td>
        <td>{dep.first_name}</td>
        <td>{dep.last_name}</td>
        <td>{dep.relationship}</td>
        <td>{dep.employee_id}</td>

    </tr>
))}

  </tbody>
</table>
</div>
    );
};

export default Dependent;
